import React from "react";

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons'

function Search(){
    return(
        <div class="Searchbar">
            <form>
                <button type="submitsearch" class="w3-right "> <FontAwesomeIcon icon={faSearch}/> </button>
                <input class="w3-right" type="text" placeholder="Search for Recipes ..."/>
            </form>
        </div>
    );
}

export default Search;
